import React, { useState } from "react";

const NavBar = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="py-3 px-4 bg-[#FFFFFF] border-b-2  flex-wrap ">
      <div className="flex items-center justify-between">
      <div className={`flex items-center gap-2`}>
      <img src={`images/company-logo.svg`} alt='logo' />
        <img src={`images/round-side.svg`} alt='logo' />
      </div>
      <input className="border-[1px] pl-7 pr-12 rounded-[12px] outline-none h-[38px] w-full max-w-[50%]" type="text" placeholder="Search" />
      <button
        className="md:hidden text-black text-2xl"
        onClick={() => setIsOpen(!isOpen)}
      >
        {isOpen ? "✖" : "☰"}
      </button>
      <div className={`
     absolute md:static top-[60px] left-0 w-full md:w-auto bg-white md:bg-transparent p-4 md:p-0 shadow-md md:shadow-none flex flex-row  md:flex-row md:items-center gap-2 transition-all duration-300 ${isOpen ? "block" : "hidden md:flex"
        }`}>
        <img src={`images/bell.svg`} className="cursor-pointer" alt='logo' />
        <select className="w-full border-0 rounded-md p-2">
          <option>
          Select Client
          </option>
        </select>
      </div>
      </div>
    </nav>
  )
}

export default React.memo(NavBar)
